import React from 'react';

const foodILike = [
  {
    name : "kimchi",
    url : "https://www.google.com/imgres?imgurl=http%3A%2F%2Fwww.olivenote.co.kr%2Fnews%2Fphoto%2F201705%2F129_115_4133.jpg&imgrefurl=http%3A%2F%2Fwww.olivenote.co.kr%2Fnews%2FarticleView.html%3Fidxno%3D129&docid=iU_gYQoTjYzvsM&tbnid=jVWN6AZovrS5YM%3A&vet=10ahUKEwiS2d-jnLfmAhUOrZQKHWqfA3AQMwiEASgDMAM..i&w=1232&h=1230&bih=950&biw=1148&q=%EC%9D%8C%EC%8B%9D%20%EC%9D%B4%EB%AF%B8%EC%A7%80&ved=0ahUKEwiS2d-jnLfmAhUOrZQKHWqfA3AQMwiEASgDMAM&iact=mrc&uact=8"    
  },
  {
    name : "ramen",
    url : "https://www.google.com/imgres?imgurl=http%3A%2F%2Fwww.olivenote.co.kr%2Fnews%2Fphoto%2F201705%2F129_115_4133.jpg&imgrefurl=http%3A%2F%2Fwww.olivenote.co.kr%2Fnews%2FarticleView.html%3Fidxno%3D129&docid=iU_gYQoTjYzvsM&tbnid=jVWN6AZovrS5YM%3A&vet=10ahUKEwiS2d-jnLfmAhUOrZQKHWqfA3AQMwiEASgDMAM..i&w=1232&h=1230&bih=950&biw=1148&q=%EC%9D%8C%EC%8B%9D%20%EC%9D%B4%EB%AF%B8%EC%A7%80&ved=0ahUKEwiS2d-jnLfmAhUOrZQKHWqfA3AQMwiEASgDMAM&iact=mrc&uact=8"    
  },
  {
    name : "samgusal",
    url : "https://www.google.com/imgres?imgurl=http%3A%2F%2Fwww.olivenote.co.kr%2Fnews%2Fphoto%2F201705%2F129_115_4133.jpg&imgrefurl=http%3A%2F%2Fwww.olivenote.co.kr%2Fnews%2FarticleView.html%3Fidxno%3D129&docid=iU_gYQoTjYzvsM&tbnid=jVWN6AZovrS5YM%3A&vet=10ahUKEwiS2d-jnLfmAhUOrZQKHWqfA3AQMwiEASgDMAM..i&w=1232&h=1230&bih=950&biw=1148&q=%EC%9D%8C%EC%8B%9D%20%EC%9D%B4%EB%AF%B8%EC%A7%80&ved=0ahUKEwiS2d-jnLfmAhUOrZQKHWqfA3AQMwiEASgDMAM&iact=mrc&uact=8"    
  }
];

function Food({name, url}) {
return <div>
    <h2>I like {name}</h2>
      <img src={url} />
    </div>;
}

function App() {
  return (
    <div className="App">
    {foodILike.map(dish => (<Food name={dish.name} url={dish.url} />))}
    </div>
  );
}

export default App;
